import React from 'react';

function Video() {
  return <div><iframe width="320" height="240" src="https://www.youtube.com/embed/JrEEKaDSF4k" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></div>;
  <video src="./M.mp4" type="video/mp4" />;
}

export default Video;
